import React, { useEffect } from "react";
import "./App.css";
import { useApiGet, TApiResponse } from "./hooks/useApiHook";

const App: React.FC = () => {
  useEffect(() => {
    const url = "https://restcountries.com/v2/all/";
  }, []);

  // call to the hook

  const data: TApiResponse = useApiGet("https://restcountries.com/v2/all/");
  console.log(data);

  return <div className="App"></div>;
};

export default App;
